import React from 'react'
import SignIn from '../../AuthFlow/SignIn/SignIn'
import LoginIn from '../../AuthFlow/LoginIn/LoginIn'
import ForgotPassword from '../../AuthFlow/ForgotPassword/ForgotPassword'
import Otp from '../../AuthFlow/OTP/Otp'
import main from '../../AppFlow/MainScreen/main'
import { BrowserRouter as Router, Routes, Route,} from 'react-router-dom'

const AppStack = () => {
    return(
            <Routes>
                <Route path='/app/main' component={main}/>
            </Routes>
    )
}

const AuthStack = () => {
    return(
            <Routes>
                <Route path='/app/Signin' component={SignIn}/>
                <Route path='/app/Login' component={LoginIn}/>
                <Route path='/app/Forgotpasscode' component={ForgotPassword}/>
                <Route path='/app/Otp' component={Otp}/>
            </Routes>
    )
}

const AppRouter = () => {
    const isAuthenticated = true
    return (
        <Router>
            <Routes>
            {isAuthenticated ? (
                    <Route path='/' component={AppStack}/>
                ): 
                    <Route path='/auth' component={AuthStack}/>
                }
            </Routes>
        </Router>
    )
}


export default AppRouter
